import React, { useEffect, useState } from "react";
import { getFormulaire } from "../services/ApiService";

export default function FormulaireList() {
    const [formulaires, setFormulaires] = useState([]); // Corrected variable name

    useEffect(() => {
        let mount = true;
        getFormulaire()
            .then(res => {
                console.log("res from Api ", res);
                setFormulaires(res);
                return () => (mount = false);
            });
        return () => {
            mount = false;
        };
    }, []);
(
        <>
            <h3>Formulaire</h3>
            <table>
                <thead>
                    <tr>
                        <th>Nom</th>
                        <th>Pr√©nom</th>
                        <th>Email</th>
                    </tr>
                </thead>
                <tbody>
                    {formulaires.map(formulaire => {
                        return (
                            <tr key={formulaire.formulaire_id}>
                                <td>{formulaire.nom}</td>
                                <td>{formulaire.prenom}</td>
                                <td>{formulaire.mail}</td>
                                <td><button type="submit">Envoyer</button> </td>
                            </tr>
                        );
                    })}
                </tbody>
            </table>
        </>
    );
}
